import React from 'react';

const Card = () => {
    return (
        <div className='bg-light-green dib br3 pa3 ma2 grow bw2 shadow'>
            <img src='https://robohash.org/test?200x200' alt='robots' />
            <div>
                <h2>Jane Dow</h2>
                <p>amit@gmail.com </p>
            </div>
        </div>
    );
}


export default Card;
